import WidgetsHandler from './container/widgetsHandler';
import Header from './container/header';
import {Container, Row, Col} from 'reactstrap';
import './App.css';

class App extends Component {
  render() {
    return (
      <div class="HomePage">
      <Header/>
      {this.props.children}
      </div>
    );
  }
}

export default App;


